import React from "react";
import { Link } from 'react-router-dom';


function ArtistsCardStaticThree(props) {
    return (
        <div class="card  text-black">
            <img class="card-img-top fixed-height-img" src="StaticImages/ttcp.jpeg" alt="artistsPic" />
            <div class="card-body">



            <Link to={`/artists/artistspage/staticinstance3`}><h5><b>{props.ArtistsName}</b></h5><p>{props.Genre}</p></Link>
            </div>
            <div class="card-body p-5">{props.VenueList}</div>

        </div>


    );

}

export default ArtistsCardStaticThree;
